import React from 'react';

const CheckBox = ({ options, value, setValue }) => {
  return (
    <div>
      {options.map((option) => (
        <label key={option}>
          <input type="checkbox" name={option} id={option} value={value} onChage={[...option, setValue]} />
        </label>
      ))}
    </div>
  );
};

export default CheckBox;
